import React from 'react';
import './App.css';
import Employee from './components/Employee';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import Login from './components/Login/Login';


function App() {
  return (
    <div className="App">
      <Router>
        <div className='menu'>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/employee/">Employee</Link>
              </li>
              <li>
                <Link to="/login/">Login</Link>
              </li>

            </ul>
          </nav>

          <Switch>

            <Route path="/employee">
              <Employee />
            </Route>

          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
